use morelka;

























update items 
set kupione = 0;

update items it join zawartosczamowienia zz 
on it.item_id = zz.item_id 
set it.kupione = (select sum(ilosc) from zawartosczamowienia where item_id = it.item_id);

update zamowienia z left join zawartosczamowienia zz 
on z.zamowienia_id = zz.zamówienie_id 
set z.cena = 0;

update zamowienia z join zawartosczamowienia zz 
on z.zamowienia_id = zz.zamówienie_id 
set z.cena = (select sum(ilosc * cena) from zawartosczamowienia where zamówienie_id = z.zamowienia_id);